var out int
var outbool bool

func naiveCount(s []byte, c byte) int {
	count := 0
	for i := 0; i < len(s); i++ {
		if s[i] == c {
			count++
		}
	}
	return count
}

func naiveCompare(s1 []byte, s2 []byte) bool {
	if len(s1) != len(s2) {
		return false
	}
	for i := 0; i < len(s1); i++ {
		if s1[i] != s2[i] {
			return false
		}
	}
	return true
}

func BenchmarkNaiveCount(b *testing.B) {
	var k int
	for n := 0; n < b.N; n++ {
		k = naiveCount(countme, 100)
	}
	out = k
}
func BenchmarkBytealgCount(b *testing.B) {
	var k int
	for n := 0; n < b.N; n++ {
		// Uses bytealg under the hood
		k = bytes.Count(countme, []byte{100})
	}
	out = k
}
func BenchmarkNaiveCompare(b *testing.B) {
	var k bool
	for n := 0; n < b.N; n++ {
		k = naiveCompare(countme, countme2)
	}
	outbool = k
}

func BenchmarkEqualStringConversion(b *testing.B) {
	var k bool
	for n := 0; n < b.N; n++ {
		// In theory does the same as bytes.Equal, which seems to be true.
		k = string(countme) == string(countme2)
	}
	outbool = k
}
